import { useEffect, useMemo,useState } from "react";
const App=()=> {
  const [state,setState]=useState([]);
  const lists=useMemo(()=>{
    let mass=state.filter((elem)=>{
      console.log(elem.searchInfo.textSnippet);
      return elem.volumeInfo.imageLinks!=undefined
    })
    return mass.map((elem)=>{
      return <a href={elem.volumeInfo.infoLink}>
        <img src={elem.volumeInfo.imageLinks.thumbnail}/>
      </a>
    })
  },[state.length]);
  useEffect(() => {
    const key = "AIzaSyBEIqK7j9rLo7FHM4Fdl41EITEsGLHFx9E", book = "Harry Poter";
    fetch(`https://www.googleapis.com/books/v1/volumes/?q=${book}&key=${key}&maxResults=40`)
    .then((res) => {
      res.json().then(({items})=>{
        setState(items)
      })
    });
  }, []);
  return (<>
    {lists}
  </>)
}
export default App;
